Enstitümüz bünyesinde faaliyetlerini sürdüren 
@Teknoparkizmir_
 ile Havacılık Uzay Kümelenmesi Derneği arasında protokol imzalandı. Yapılan protokol ile Türk Havacılık, #Uzay ve Savunma Sanayii’nin üretim, tasarım ve Ar-Ge konularında ortak projeler geliştirilmesi amaçlanıyor.

#uzay #uydu çalışmaları #KBRN 
